    override fun insereix(mission: Mission): Boolean {
        var result: Boolean = true;
        val entityDaoImpl = factoryDaoEntities.createDao(Origin.MEMORY);
        val dataEntity: List<Entity>;
        val indexParentEntity: Int;
        val parentEntity: Entity;

        dataEntity = entityDaoImpl.obtenTots();
        indexParentEntity = dataEntity.indexOfFirst{ n -> n.id == mission.acceptedBy };
        if(dades.any{it.id == mission.id})
            result = false;
        else
        {
            if(indexParentEntity >= 0)
            {
                parentEntity = entityDaoImpl.obtenPerID(mission.acceptedBy)!!;
                if(dades.count{ n -> n.acceptedBy == mission.acceptedBy } <
                    dataEntity.find{ n -> n.id == mission.acceptedBy }!!.MAX_MISSIONS)
                {
                    dades.add(mission);
                    parentEntity.missionsAccepted.add(mission.id);
                }
                else
                    result = false;
            }
            else
                result = false;
        }

        return result;
    }

    override fun actualitza(mission: Mission): Boolean {
        val position = dades.indexOfFirst { it.id == mission.id };
        var result: Boolean = true;
        val entityDaoImpl = factoryDaoEntities.createDao(Origin.MEMORY);
        val dataEntity: List<Entity>;
        val indexParentEntity: Int;

        dataEntity = entityDaoImpl.obtenTots();
        indexParentEntity = dataEntity.indexOfFirst{ n -> n.id == mission.acceptedBy };
        if(position < 0)
            result = false;
        else
        {
            if(indexParentEntity >= 0)
            {
                if(dades.count{ n -> n.acceptedBy == mission.acceptedBy } <
                    dataEntity.find{ n -> n.id == mission.acceptedBy }!!.MAX_MISSIONS ||
                    mission.acceptedBy == dades[position].acceptedBy)
                {
                    dades[position] = mission;
                }
                else
                    result = false;
            }
            else
                result = false;
        }

        return result;
    }

    override fun elimina(id: Int): Boolean {
        var result: Boolean = true;
        val position = dades.indexOfFirst { it.id == id }
        if(position < 0)
            result = false;
        else
            dades.removeAt(position);

        return result;
    }

    override fun obtenPerID(id: Int): Mission? {
        return dades.firstOrNull{id == it.id}
    }

    override fun obtenTots(): List<Mission> {
        return dades.toList();
    }
}